import React from "react";
import styles from "./SignUp.module.css";
import { Link } from "react-router-dom";

const LogIn = () => {
  const onSubmitHandler = (event) => {
    event.preventDefault();
  };

  return (

    <div class="background">
      <p id="login">Login </p><br /> <p id="signin">Not a member yet? <u style="color:lightblue;"> Sign up  </u></p>
      <div class="social_media">
        <button id="Facebook"><a href="#" style="text-decoration: none;color:white">Log in with Facebook</a></button>
        <button id="Gmail"><a href="#" style="text-decoration: none;color:white">Log in with Gmail</a></button>
      </div>

      <form onSubmit={onSubmitHandler}>
        <div class="container">
          <input type="text" placeholder="Enter Username" name="username" required /><br />
          <input type="password" placeholder="Enter Password" name="password" required /><br />
          <input type="checkbox" checked="checked_box" style="margin-left:-20px;" /> Remember me
          <a style="margin-left:200px;">Forgot password? </a><br /><br /><br />
          <button type="submit" class="button log_but">Login</button> <br />
        </div>

      </form>
    </div>
  );
};

export default LogIn;
